"221048":{"id":"221048","name":"A Cúmplice do Mal: Monique Olivier","slug":"a-cumplice-do-mal-monique-olivier","original_title":"L'Affaire Fourniret : Dans la tête de Monique Olivier","overview":"Entre 1987 e 2003, Michel Fourniret ficou conhecido como o maior assassino da França. Mas a esposa dele era um enigma: será que ela era vítima… ou cúmplice?","first_air_date":"2023-03-02","episode_run_time":42,"vote_average":7.269,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":[],"genres":["Documentário","Crime"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/5rmKeicNGrlZFyj1CNjznF7F16y.jpg","poster_path":"https://image.tmdb.org/t/p/original/mcUcRDuHybxhSmIWJ7Oh6WyvnaZ.jpg","cast":["Francis Nachbar","Gérard Chemla","Richard Delgenes","Cédric Visart De Bogarmé","Jean-Luc Ployé"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2023-03-02","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Esposa do Monstro","overview":"Junho de 2003. As autoridades belgas prendem Michel Fourniret por tentativa de sequestro e atentado ao pudor. Outros dois casos levam a polícia a interrogar sua esposa.","air_date":"2023-03-02","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/7yz1ziHYOeSwXsnl6uZ0eX3YVNJ.jpg","vote_average":0},"2":{"name":"Pacto Diabólico","overview":"Cartas, solidão e um pacto mortal. Olivier fica sob custódia, e psicólogos tentam entender seu envolvimento nos crimes do marido.","air_date":"2023-03-02","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/mLaRqzgVvcO12msXDjTmRXmYDpS.jpg","vote_average":0},"3":{"name":"Os Ogros das Ardenas","overview":"Um promotor recorda a frieza de Olivier e Fourniret quando os corpos foram encontrados. Surgem dúvidas sobre a fortuna e o castelo do casal.","air_date":"2023-03-02","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/vQhXZvMscKUiiJv2iXWiN3f9JaY.jpg","vote_average":0},"4":{"name":"Gênio do Mal","overview":"Com a abertura do julgamento, o papel de Olivier como mãe aumenta o fascínio do público mas também o ódio. Os crimes do casal, e sua vida sexual, começam a ser revelados.","air_date":"2023-03-02","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/lBn9pVMUMN9br3JXm271GG1cOZO.jpg","vote_average":0},"5":{"name":"Guardiã dos Segredos","overview":"Em 2021, Olivier trabalha em um caso arquivado, mas suas motivações não são claras. Será que ela consegue recuperar sua humanidade após a morte de Fourniret?","air_date":"2023-03-02","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/4AIc4URYF7SWstny3qqaOa3Eo7O.jpg","vote_average":0}}}}},
