"199001":{"id":"199001","name":"Minha Vida com a Família Walter","slug":"minha-vida-com-a-familia-walter","original_title":"My Life with the Walter Boys","overview":"Uma tragédia transforma a vida de uma adolescente. E agora ela tem que morar em uma cidadezinha com a família da tutora, onde aprende sobre amor, esperança e amizade.","first_air_date":"2023-12-07","episode_run_time":0,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Melanie Halsall"],"production_companies":["iGeneration Studios","Nomadic Pictures","Sony Pictures Television - International Production"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/oCXAXxPAj4VH35FPvO1Trog4imV.jpg","poster_path":"https://image.tmdb.org/t/p/original/jg3YdxDNlxay0NWTxgAPif647Hj.jpg","cast":["Nikki Rodriguez","Noah LaLonde","Ashby Gentry","Johnny Link","Corey Fogelmanis"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/iW1b170gv5J6poTVRMOhCndCgUo.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/iW1b170gv5J6poTVRMOhCndCgUo.jpg","air_date":"2023-12-07","episode_count":10,"overview":"Uma tragédia transforma a vida de uma adolescente. E agora ela tem que morar em uma cidadezinha com a família da tutora, onde aprende sobre amor, esperança e amizade.","vote_average":8.7,"episodes":{"1":{"name":"Bem-vinda ao Colorado","overview":"Após uma trágica perda, Jackie vai morar com a família Walter e tenta se adaptar à vida no campo, mas a nova casa e a nova escola trazem desafios.","air_date":"2023-12-07","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/4C4e04oPukV9oN77kBbB3FLHmcJ.jpg","vote_average":8.7},"2":{"name":"Viva um pouco","overview":"Os garotos pregam uma peça em Jackie e ela conta tudo para Katherine, mas logo descobre que eles têm um jeito particular de resolver os problemas.","air_date":"2023-12-07","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/vLiGXz7hwp8plPTDE4fHKF0tqJP.jpg","vote_average":8.2},"3":{"name":"O efeito Cole","overview":"No evento de reencontro, Alex e Jackie trabalham no carrinho de cidra da família Walter com a ajuda de Cole, que está tendo dificuldades para aceitar a vida sem futebol.","air_date":"2023-12-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/2DYd7HQQ2ATsR2QEp5DNJyl4Wye.jpg","vote_average":9.5},"4":{"name":"Dezenove","overview":"No aniversário da Lucy, Jackie decide faltar à escola para ir a uma festa em uma casa no lago com Cole, onde jogam uma versão ousada de Verdade ou Desafio.","air_date":"2023-12-07","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/rqOYvCEfNzi4oe2ri9lTmT2Glgo.jpg","vote_average":9.6},"5":{"name":"Dia de Ação de Graças","overview":"Em seu primeiro Dia de Ação de Graças sem a família, Jackie recebe uma visita surpreendente e precisa tomar uma decisão difícil.","air_date":"2023-12-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/dYyiWWgeUPA48b8kB7SwvzlSu49.jpg","vote_average":10},"6":{"name":"Bagagem","overview":"Antes da festa da fogueira, Jackie descobre sobre a história de Cole e Alex com uma garota. Na festa, novos e antigos relacionamentos pegam fogo.","air_date":"2023-12-07","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/vD3aBDnCl4bsyGaHcWl9ozbrrmr.jpg","vote_average":8.3},"7":{"name":"Fofocas de cidade pequena","overview":"Com os rumores tomando conta, a rivalidade entre Alex e Cole chega ao limite. Mais tarde, a família precisa lidar com uma emergência preocupante.","air_date":"2023-12-07","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/iP8bMlo8ug1BOzdIBaQBCXMgvSA.jpg","vote_average":5},"8":{"name":"Descontrolado","overview":"Katherine ganha um prêmio por seu trabalho veterinário, e toda a família se une para apoiá-la, exceto Cole, que se afunda em escolhas erradas.","air_date":"2023-12-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/a5dIjS6PgaTdUCuEEO92jRvRpBx.jpg","vote_average":0},"9":{"name":"Revoluções","overview":"Jackie tem uma entrevista importante e perde a competição de Alex no rodeio. Ela tenta manter a distância de Cole após o incidente entre os dois.","air_date":"2023-12-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/26QioQ2LcS71MLGUl5cOVvEGffF.jpg","vote_average":0},"10":{"name":"Felizes para sempre","overview":"Com a ajuda dos irmãos Walter, Jackie planeja um casamento perfeito na fazenda, mas nada pode prepará-la para o que acontecerá em seguida.","air_date":"2023-12-07","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/3GCxWKyprG9tCNWfgInMSg4v4PX.jpg","vote_average":10}}}}},
