"111616":{"id":"111616","name":"Primeira Morte","slug":"primeira-morte","original_title":"First Kill","overview":"O amor é uma coisa meio complicada para Juliette e Calliope: uma é vampira, a outra é caçadora de vampiros. E as duas estão prontas para matar pela primeira vez.","first_air_date":"2022-06-10","episode_run_time":0,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":8,"created_by":["V. E. Schwab"],"production_companies":["Belletrist Productions"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/abFQcEO0UJVfUQPmhgjaKeLxRwy.jpg","poster_path":"https://image.tmdb.org/t/p/original/mqRDDqlX8jR6vHQl8h7wy0ej34L.jpg","cast":["Sarah Catherine Hook","Imani Lewis","Elizabeth Mitchell","Aubin Wise","Gracie Dzienny"],"trailer":"vi6ZUQwRbEs","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/mqRDDqlX8jR6vHQl8h7wy0ej34L.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/mqRDDqlX8jR6vHQl8h7wy0ej34L.jpg","air_date":"2022-06-10","episode_count":8,"overview":"N/A","vote_average":9.3,"episodes":{"1":{"name":"Primeiro beijo","overview":"Pressionada pelos pais para trocar as pílulas por sangue de verdade, Juliette fica de olho na novata Cal, que tem seus próprios estresses familiares.","air_date":"2022-06-10","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/bGyfx6OaNGT3jKWdpS62Nj4u41p.jpg","vote_average":7.886},"2":{"name":"Primeiro sangue","overview":"As consequências chocantes da festa de Noah trazem mais perguntas do que respostas. A mãe de Juliette tira as próprias conclusões. Um monstro vai atrás da família de Cal.","air_date":"2022-06-10","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/zXW63qEoGoSA1jYjDtZn0GVQ60j.jpg","vote_average":9.7},"3":{"name":"Primeira briga","overview":"Juliette dá um passo maior do que a perna antes de sua grande noite. Cal não se sente à vontade com os preparativos da família para uma arriscada caça a vampiros.","air_date":"2022-06-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/bD08zkBbvSHrqJJbtULFNVJHd36.jpg","vote_average":10},"4":{"name":"Primeiro encontro","overview":"Juliette e Cal enfrentam um inimigo comum em meio ao caos da cerimônia de consagração. Lados são escolhidos, acordos são feitos e marcos são alcançados.","air_date":"2022-06-10","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/3mNqA0XGlvOgnYX2yXII9KtL5aj.jpg","vote_average":9.625},"5":{"name":"Primeiro amor","overview":"Cal e Juliette abrem o coração num refúgio. Uma estranha ameaça espreita a escola. As negociações sobre o futuro de Elinor ficam brutais.","air_date":"2022-06-10","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/3GMfL8iP12obxOS2SlcwnTCdRYu.jpg","vote_average":8.5},"6":{"name":"Primeiro ritual","overview":"Os esforços para separar Juliette e Cal se intensificam. As duas famílias, desconfiadas, chegam a um acordo durante uma investigação de assassinato.","air_date":"2022-06-10","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/6f9qll6Orjp3BZuQhCczlyxR2dn.jpg","vote_average":9.667},"7":{"name":"Primeiro adeus","overview":"As tensões aumentam em Savannah, colocando Cal e Juliette em risco. Theo busca informações sobre seu passado antes de sair em uma missão malsucedida com Apollo.","air_date":"2022-06-10","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/9zfwvrvTPdNN4iqA1oqioSVdIOC.jpg","vote_average":9.667},"8":{"name":"Primeira traição","overview":"O sangue jorra e a traição queima depois que uma reviravolta chocante deixa um rastro de destruição e testa os laços de amor entre Cal e Juliette.","air_date":"2022-06-10","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/8AepWeRpgSqq3nk6kYBX0gtbyof.jpg","vote_average":9.6}}}}},
