"87508":{"id":"87508","name":"Crimes em Déli","slug":"crimes-em-deli","original_title":"दिल्ली क्राइम","overview":"Nesta série inspirada em eventos reais e fictícios, a força policial investiga crimes chocantes na Índia.","first_air_date":"2019-03-22","episode_run_time":0,"vote_average":7.8,"number_of_seasons":3,"number_of_episodes":12,"created_by":["Richie Mehta"],"production_companies":["Ivanhoe Pictures","Golden Karavan","Poor Man's Productions"],"genres":["Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/j6djmR4hi8ULL0xUPQN4ZVyzgVN.jpg","poster_path":"https://image.tmdb.org/t/p/original/vGzAXqRLo3LP66c4zq4FPIx7qHx.jpg","cast":["Shefali Shah","रसिका दुग्गल","Avijit Dutt","Adil Hussain","Yashaswini Dayama"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vGzAXqRLo3LP66c4zq4FPIx7qHx.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vGzAXqRLo3LP66c4zq4FPIx7qHx.jpg","air_date":"2019-03-22","episode_count":7,"overview":"Após o estupro coletivo que chocou Nova Déli, a comissária adjunta de polícia Vartika Chaturvedi lidera a busca pelos culpados. Inspirado no caso Nirbhaya, de 2012.","vote_average":8,"episodes":{"1":{"name":"Episódio 1","overview":"Após duas vítimas de um crime brutal serem encontradas, a comissária Vartika Chaturvedi escolhe apenas os oficiais de sua maior confiança para liderar a investigação.","air_date":"2019-03-22","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/a4bQdgPez3d8By5ZpZtSZgH4KCP.jpg","vote_average":9},"2":{"name":"Episódio 2","overview":"Com poucas pistas, a equipe de Vartika se concentra em identificar o ônibus onde o crime ocorreu. Vazamentos para a mídia provocam reação contra a polícia.","air_date":"2019-03-22","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/cbfQF2TuMoWaGZEMjDpgHjMuOVU.jpg","vote_average":8},"3":{"name":"Episódio 3","overview":"Detalhes perturbadores sobre a noite do crime vêm à tona no novo interrogatório do motorista de ônibus Jai Singh. Começa a caça por seus cinco cúmplices.","air_date":"2019-03-22","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/tV30EsM6HpXnnJslxJmjqKzMEFM.jpg","vote_average":8},"4":{"name":"Episódio 4","overview":"O quarto suspeito é capturado. Na medida em que cresce a indignação pública, Vartika e o comissário Kumar precisam defender a polícia dos rumores de má conduta.","air_date":"2019-03-22","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/w2ZE1V23oT3ftKR36gJdmGq6NpT.jpg","vote_average":8},"5":{"name":"Episódio 5","overview":"A caça aos dois suspeitos remanescentes ganha força. Vartika enfrenta a raiva da equipe, o medo da filha e a própria culpa. Kumar encara ativistas furiosos.","air_date":"2019-03-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/hHRy0l1oR9xK7ckeVV18AlwyaXC.jpg","vote_average":7},"6":{"name":"Episódio 6","overview":"A vítima masculina, Akash, se sente tentada a falar com a mídia, para o desânimo de Vartika. O ministro-chefe continua na missão de derrubar Vartika e Kumar.","air_date":"2019-03-22","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/8ytiBl4fPj1udQ53MawsjwWd1ts.jpg","vote_average":8},"7":{"name":"Episódio 7","overview":"O quinto suspeito surpreende a polícia. Protestos do lado de fora do parlamento terminam em tumulto. A busca pelo suspeito final leva a uma perseguição.","air_date":"2019-03-22","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/epa54d66O5S171Emt1xx7pkQhTi.jpg","vote_average":8}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/xwK3JdYQpEH7bYocbngvB9XQcEm.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/xwK3JdYQpEH7bYocbngvB9XQcEm.jpg","air_date":"2022-08-26","episode_count":5,"overview":"Uma série de assassinatos indica o retorno de uma terrível gangue criminosa, e a policial Vartika precisa liderar o caso sob pressão da mídia e do público.","vote_average":7.4,"episodes":{"1":{"name":"Episódio 1","overview":"Vartika e sua equipe recebem a notícia de um crime terrível. As evidências apontam para uma gangue que não aparecia na cidade há 20 anos.","air_date":"2022-08-26","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/d5GtWJmx8sOgq8p0T1lYF5KYvHk.jpg","vote_average":8},"2":{"name":"Episódio 2","overview":"Depois de outro assassinato, o inspetor Chaddha entra na equipe. Os detalhes do caso vazam para a imprensa, e Vartika acha que a fonte é um informante da polícia.","air_date":"2022-08-26","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/tsO3mJUKE0axbju7hK3yJsfbUpv.jpg","vote_average":7},"3":{"name":"Episódio 3","overview":"A equipe investiga dois suspeitos e faz descobertas reveladoras. Pressionada para acalmar a mídia e o público, Vartika enfrenta um dilema moral.","air_date":"2022-08-26","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/35eBew6heuNPLn5lfjHqUfBD32D.jpg","vote_average":8},"4":{"name":"Episódio 4","overview":"Correndo contra o tempo, Vartika opta por uma nova abordagem. Neeti encontra uma ligação entre os assassinatos. Uma nova pista leva a um suspeito.","air_date":"2022-08-26","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/yCxSuZZIuoKgtKSfhd0ZdAo30vy.jpg","vote_average":7},"5":{"name":"Episódio 5","overview":"A equipe encontra o esconderijo dos suspeitos. Vartika precisa descobrir se Lata está mesmo fugindo ou se escondendo para finalmente revelar sua história.","air_date":"2022-08-26","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/wL2jYMacqz19Uqb0jXLGQlxWNBR.jpg","vote_average":7}}},"3":{"name":"Temporada 3","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"N/A","episode_count":0,"overview":"N/A","vote_average":0,"episodes":{}}}},
