"274912":{"id":"274912","name":"Amor: Verdade ou Consequência – África do Sul","slug":"amor-verdade-ou-consequencia-africa-do-sul","original_title":"Love Never Lies: South Africa","overview":"Neste reality de namoro ambientado na África do Sul, seis casais colocam seus relacionamentos à prova, encarando as tentações e um detector de mentiras impiedoso.","first_air_date":"2024-11-29","episode_run_time":0,"vote_average":10,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Rapid Blue"],"genres":["Reality"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/d8RzNPsx5u0bvbnHmHLk1rzrToU.jpg","poster_path":"https://image.tmdb.org/t/p/original/n2hjFAP3gl9gTPqsoDjwCtxU1Pu.jpg","cast":["Minnie Dlamini"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/n1sZjcU97j5Bqgj180ivJMlSmhH.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/n1sZjcU97j5Bqgj180ivJMlSmhH.jpg","air_date":"2024-11-29","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O amor passa pelo detector de mentiras","overview":"Minnie conhece os seis casais apaixonados e faz um interrogatório usando um detector de mentiras.","air_date":"2024-11-29","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/3vwNk7sQFk9If4yb89varYNtZK.jpg","vote_average":0},"2":{"name":"A tentação entra em cena","overview":"As emoções ficam à flor da pele quando os casais são divididos entre a Villa Umgowo, feita para a reflexão profunda, e a Villa Umjolo, feita para a tentação.","air_date":"2024-11-29","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/4zuU4qVVQMjQKfuSStRcOzgu7JB.jpg","vote_average":0},"3":{"name":"Perdoe o meu linguajar","overview":"Os participantes da Umgowo ficam de coração partido com as gravações da Umjolo, mostrando seus parceiros curtindo com os novos colegas de casa.","air_date":"2024-11-29","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/z8Tl2KtUtUh8MKvVUopwwWPTtiJ.jpg","vote_average":0},"4":{"name":"O jogo virou","overview":"Nancy e Nikiwe não conseguem superar as traições dos parceiros. Os grupos trocam de lugar e chegam novos solteiros.","air_date":"2024-11-29","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/lR7q21XmXl8q4pW45ODBO2cdhp1.jpg","vote_average":0},"5":{"name":"Eu quero aquele pepino","overview":"Com a troca de casas, os novos moradores da Umjolo fazem a festa. Será que eles vão se comportar ou vão querer se vingar?","air_date":"2024-11-29","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/hQwHymYh5HIkmlvqx1WAh6dbeXm.jpg","vote_average":0},"6":{"name":"Isso é muito desrespeitoso","overview":"Será que os casais vão conseguir salvar a relação? Ou será que o estrago foi grande demais? Minnie conversa com cada um deles para ver como estão as coisas.","air_date":"2024-11-29","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/fdqnxSBJvy8us0oJOQQOm6879oI.jpg","vote_average":0},"7":{"name":"É hora de admitir a verdade","overview":"Com a cerimônia final se aproximando, os casais encaram um último teste de confiança. Quem será que vai levar pra casa esse prêmio que só aumenta?","air_date":"2024-12-06","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/cSAyXgiGceozmrI4d5N6Wm4opKE.jpg","vote_average":0},"8":{"name":"O reencontro","overview":"Os seis casais encontram a apresentadora Minnie Dlamini um ano depois para revisitar suas jornadas em um reencontro cheio de drama e fofocas. Será que o amor venceu?","air_date":"2024-12-08","runtime":81,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
