"195298":{"id":"195298","name":"O Cangaceiro do Futuro","slug":"o-cangaceiro-do-futuro","original_title":"O Cangaceiro do Futuro","overview":"Na história, um cabra frouxo que mora em São Paulo sonha em voltar rico pro Nordeste... até que leva um tabefe no pé do ouvido e vai parar em 1927.","first_air_date":"2022-12-25","episode_run_time":0,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Halder Gomes"],"production_companies":["Glaz Entretenimento"],"genres":["Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/7yvLgEgMwcinj0t5LD2ufuxqkAY.jpg","poster_path":"https://image.tmdb.org/t/p/original/j0TdeK3G8FIsZ6rtY1G22UN5mKi.jpg","cast":["Edmilson Filho","Dudu Azevedo","Chandelly Braz","Haroldo Guimarães","Max Petterson"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/j0TdeK3G8FIsZ6rtY1G22UN5mKi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/j0TdeK3G8FIsZ6rtY1G22UN5mKi.jpg","air_date":"2022-12-25","episode_count":7,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"O Rei do Cagaço","overview":"Após levar uma pancada na cabeça, Virguley acorda na década de 1920 e descobre que é a cara do Lampião, o famoso e temido rei do cangaço.","air_date":"2022-12-25","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/wA9QMPfWXYGfP2EnEkNmxH4RYLg.jpg","vote_average":10},"2":{"name":"Frescando com o Inimigo","overview":"Fingindo ser Lampião, Virguley conhece Mariá, uma costureira jovem e atraente que sonha em entrar para o bando e ajudar sua vila.","air_date":"2022-12-25","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/jK39a8fPybTWB7sy0ENtBKbCahb.jpg","vote_average":0},"3":{"name":"Oxente, Formô!","overview":"Virguley e Mariá decidem formar seu próprio bando de cangaceiros, e o coronel não gosta nada disso. Enquanto isso, o verdadeiro Lampião aterroriza as cidades vizinhas.","air_date":"2022-12-25","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/tRF0kU7VVMtM8kKtaFtyx1vYtm7.jpg","vote_average":0},"4":{"name":"Ai-Jegue","overview":"Com seu novo bando, Virguley e Mariá tomam conta da mercearia da vila e criam o primeiro serviço de delivery do sertão. Vai ser um deus nos acuda.","air_date":"2022-12-25","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/6ms0hBkbcdFEkLaoEgU12IQ98su.jpg","vote_average":0},"5":{"name":"Com a Boca na Botija","overview":"O coronel descobre a verdade sobre Virguley e bola uma vingança. Mariá procura a botija de ouro do Lampião.","air_date":"2022-12-25","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/85V7PAJhvLt0k86EuNtSaQ9D0YU.jpg","vote_average":0},"6":{"name":"Cabra Marcado pra Morrer","overview":"Virguley cai na armadilha do coronel, e acaba sendo preso. Mariá tenta dar um jeito de se livrar do casamento arranjado com Rufino.","air_date":"2022-12-25","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/qVUPTX218wEL8bP9Dq3leQfxB4G.jpg","vote_average":0},"7":{"name":"Cagado e Cuspido","overview":"Virguley e Mariá se reencontram com o bando. O verdadeiro Lampião segue rumo à vila, e ele não está nada feliz com seu impostor.","air_date":"2022-12-25","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/CEKcS1Zl5r8dplnIwco268VxGx.jpg","vote_average":0}}}}},
