"139397":{"id":"139397","name":"Nosso Jeito de Ser","slug":"nosso-jeito-de-ser","original_title":"As We See It","overview":"A história de Jack, Harrison e Violet, três colegas de quarto de vinte e poucos anos no espectro autista. A série acompanha os protagonistas enquanto eles se esforçam para conseguir e manter seus empregos, fazer amigos, se apaixonar e navegar em um mundo que os ilude.","first_air_date":"2022-01-20","episode_run_time":30,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Jason Katims"],"production_companies":["True Jack Productions","Universal Television","yesStudios","Amazon Studios"],"genres":["Comédia","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/rl1danwlKUwSjpIgFHaMC27oWTm.jpg","poster_path":"https://image.tmdb.org/t/p/original/i78zP1uYFiNXs9szVApcnOnKZar.jpg","cast":["Rick Glassman","Sue Ann Pien","Albert Rutecki","Chris Pang","Sosie Bacon"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/bh7OXB05LgElZDMOoxFNSJL9o4h.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/bh7OXB05LgElZDMOoxFNSJL9o4h.jpg","air_date":"2022-01-20","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Piloto","overview":"Jack, Harrison e Violet, três colegas de apartamento de vinte e poucos anos, todos no espectro autista, lutam para transitar em um mundo que não é feito para eles.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/lIZTeIdjLBMmEi5JelIvDH8VGs6.jpg","vote_average":0},"2":{"name":"Me desculpe pelo que eu disse e fiz","overview":"Violet flerta com um entregador no trabalho. Harrison faz amizade com um menino que mora no prédio. Jack corre risco de perder o emprego outra vez.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/kZuhqmwIQ5QMW3xtvkzBYBw5KpD.jpg","vote_average":0},"3":{"name":"Violet e Douglas","overview":"Violet pede conselhos de relacionamento para a namorada de Van. Jack pressiona a enfermeira de Lou para obter informações sobre o diagnóstico do pai. A amizade proibida entre AJ e Harrison continua em segredo. Mandy dá o aviso-prévio de duas semanas para sair do emprego.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/c03HfLOOtUtmShIGpMi5pd8FDpC.jpg","vote_average":0},"4":{"name":"O Violetini","overview":"Violet se prepara, muito ansiosa, para sua festa de aniversário, e está animada com o progresso com Julian. Enquanto isso, Jack e Harrison fazem de tudo para conseguirem uma companhia para irem à festa.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/gpFCZmMN1pcdW1DsiMfsJfpStIa.jpg","vote_average":0},"5":{"name":"Já comeu um desses?","overview":"Jack e seu pai ficam mais próximos quando os efeitos da doença de Lou se tornam mais evidentes. Mandy recebe uma notícia inesperada dos pais de Harrison, complicando ainda mais seus planos para o futuro. Violet quer avançar em se relacionamento com Julian.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/lMTMm1cNvCjphWuUNrKIp0hkT55.jpg","vote_average":0},"6":{"name":"Encare o medo de frente","overview":"Os colegas de apartamento têm problemas em suas vidas amorosas - Violet se descontrola quando seu relacionamento com Julian não cumpre suas expectativas; Jack tenta acertar as coisas com Ewatomi; e Harrison desenvolve uma paixão não-correspondida.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/u3banxF1ch0XhqHPgt9r3XqpRhv.jpg","vote_average":0},"7":{"name":"Exposto","overview":"Jack sofre uma crise existencial. Ainda com raiva de Julian, Violet recebe a ajuda de Douglas para mudar seu modo de ver a vida. Sentindo-se traído por Mandy, Harrison se aventura sozinho pela cidade.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/iUlWKwhhxI0PVZGF1EmSISM8siN.jpg","vote_average":0},"8":{"name":"Por favor, não vá","overview":"Na festa de formatura de sua irmã, Harrison tem dificuldade de aceitar as várias mudanças que estão para acontecer em sua vida. Ao se confrontar com a realidade da doença de Lou, Jack recorre a Ewatomi. Sentindo que está perdendo o controle sobre a própria vida, Violet briga com Van. O limite entre a vida pessoal e a vida profissional de Mandy se torna cada vez mais tênue.","air_date":"2022-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/84HA8eEFL88LarwzqtBlkWspKSm.jpg","vote_average":0}}}}},
